import './Navbar.css';
import React,{useState,useEffect} from 'react';

function Navbar() {
    const [Banana,setBanana] = useState("Hay");
    
    function setFunction(){
        setBanana("Ciao");
        console.log(Banana);
    }

    useEffect(()=>{})

    return (
        <div>{()=>setFunction()}</div>
    )
}

export default Navbar
